import React from "react";
import Link from "next/link";

const Header = (props) => (
  <header>
    <h1>This is my app header</h1>
    <nav>
      <Link href="/">Home</Link>
      <Link href="/other">Other Page</Link>
    </nav>
  </header>
);

export default Header;
